import './FormStd.css';



function FormStd(){
    return(
        <form>
          <label>First Name:</label>
          <input type="text" />

          <label>Last Name:</label>
          <input type="text" /><br></br>

          <label> Location:</label>
          <input type="text" /><br></br>

          <label>Gmail:</label>
          <input type="gmail" /><br></br>

          <label>D.O.B:</label>
          <input type="date"/><br></br>

          <label>Education:</label>
          <input type="date"/>


        </form>
    );
}export default FormStd;
